import axios from 'axios';
import React from 'react';


const fetch =  async () => {
  await axios.get('https://jsonplaceholder.typicode.com/todos')
              .then(res => {
                const data = res.data
                console.log(data)
              })
}
function FetchTodos() {

  return (
    <div>
      <button onClick={fetch}>Fetch Todos</button>
      <ul></ul>
    </div>
  )
}

export default FetchTodos;
